INSERT INTO `berita` (`id_berita`, `user_kode`, `id_kategori`, `updater`, `slug_berita`, `judul_berita`, `isi`, `status_berita`, `jenis_berita`, `keywords`, `gambar`, `icon`, `hits`, `urutan`, `tanggal_mulai`, `tanggal_selesai`, `tanggal_post`, `tanggal_publish`, `tanggal`) VALUES
	(1, 'Admin', 5, '', 'sortase', 'Sortase ', '<p>Pengerjaan Di Sortase</p>', 'Publish', 'Berita', 'Sortase', 'sortase.jpg', '', 4, 0, NULL, NULL, '2019-05-13 15:51:51', '2021-06-08 15:51:36', '2021-12-08 15:17:39'),
	(2, 'Admin', 5, '', 'perkembangan-investasi', 'Carir', '<p>Menuju era globalisasi yang lebih maju, kami akan mengembangkan sayap kami disetiap provinsi guna untuk mewujudkan visi dan misi kami</p>', 'Publish', 'Layanan', 'Investasi', NULL, 'fa fa-newspaper-o', 17, 0, NULL, NULL, '2019-05-17 04:15:33', '2021-06-10 04:06:15', '2021-12-08 15:17:42'),
	(3, 'Admin', 5, '', 'lowongan-kerja', 'Lowongan Kerja', '<p>Kami memberikan kesempatan kepada para putra/i bangsa untuk bergabung bersama kami, untuk membangun perusahaan kami menuju era globalisasi demi untuk mewujudkan cita-cita dan maju bersama.</p>', 'Publish', 'Layanan', 'Lowongan Pekerjaan', NULL, 'fa fa-globe', 15, 2, NULL, NULL, '2019-05-17 04:37:00', '2021-06-10 04:36:19', '2021-12-08 15:17:45'),
	(4, 'Admin', 5, '', 'tentang-wilian-perkasa', 'TENTANG WILIAN PERKASA', '<p>Wilian Perkasa merupakan perusahaan yang bergerak dalam bidang bisnis kelapa sawit yang mempunyai pengolahan pabrik dan kebun sawit diwilayah pekanbaru. Berdiri sejak tahun 2000, wilian perkasa mengembangkan sayapnya dan terjun kedunia usaha perkebunan kelapa sawit, selain itu PT. Wilian Perkasa membuka tenaga kerja bagi masyarakat luas.</p>\r\n<p><a class="btn btn-default" href="#">join now</a>&nbsp;<a class="btn btn-default" href="#">like now</a></p>', 'Publish', 'Profil', '', 'profile1.jpg', '', 16, 1, NULL, NULL, '2019-07-26 10:38:15', '2021-06-08 10:36:47', '2021-12-08 15:17:47'),
	(5, 'Admin', 5, '', 'visi-misi', 'Visi & Misi', '<p>Visi dan Misi PT. Wilian Perkasa</p>', 'Publish', 'Profil', '', NULL, '', 14, 2, NULL, NULL, '2021-06-09 10:15:14', '2021-06-09 10:13:44', '2021-12-08 15:17:50');
