	('VM', '<p style="text-align:justify"><span style="font-family:Tahoma,Geneva,sans-serif"><span style="color:#a52a2a"><span style="font-size:48px"><strong>VISI</strong></span></span></span></p>\r\n\r\n<p style="text-align:justify"><span style="font-size:36px"><span style="font-family:Georgia,serif">Mengembangkan kualitas hidup melalui pengembangan multi industry dan menjadi perusahaan yang di percaya</span></span></p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n\r\n<p style="text-align:justify"><span style="font-family:Tahoma,Geneva,sans-serif"><span style="color:#b22222"><span style="font-size:48px"><strong>MISI</strong></span></span></span></p>\r\n\r\n<p style="text-align:justify"><span style="font-size:36px"><span style="font-family:Georgia,serif"><span style="color:#ff8c00"><strong>M</strong></span>enyediakan produk alami untuk bisnis maupun pelanggan dengan memberikan harga yang kompetitif&nbsp;dan mutu yang baik</span></span></p>\r\n\r\n<p style="text-align:justify"><span style="font-size:36px"><span style="font-family:Georgia,serif"><strong><span style="color:#ffa07a">M</span></strong>enyediakan berbagai kesempatan bagi karyawan dan komunitas local agar mereka mempunyai standar kehidupan yang lebih baik</span></span></p>\r\n\r\n<p style="text-align:justify"><span style="font-size:36px"><span style="font-family:Georgia,serif"><span style="color:#ffa07a"><strong>B</strong></span>ertansformasi menjadi perusahaan dengan manajemen yang professional dan system yang terintegrasi</span></span></p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n', 'Vision\r\n\r\nTo Improve stakeholders lives through multi-industry expansion and be the must trusted corporation \r\n\r\nMission\r\n\r\nTo provide natural product for both business and customer by providing competitive price and in acceptable quality\r\n\r\nProviding more opportunities for our employees and local communities to have a better standard of living\r\n\r\nTransform into a professional management and an integrated system\r\n\r\n\r\n\r\n\r\n', 'Admin', 'admin', '05:19:54 pm', '03:34:21 pm', '2021-12-29', '2022-03-31');
