INSERT INTO `video` (`id_video`, `judul`, `posisi`, `keterangan`, `video`, `urutan`, `bahasa`, `id_user`, `tanggal`) VALUES
	(4, 'Untung Rugi Dengan Kelapa Sawit', 'Homepage', 'Meningkatnya produksi dan ekspor kelapa sawit Indonesia, belum sepenuhnya terserap oleh penerimaan negara dari pajak. Sebagai salah satu negara dengan luas perkebunan sawit terbesar di dunia, sudah seharusnya Indonesia mampu menciptakan kebijakan dan regulasi, terkait penerimaan negara di sektor pajak. \r\n\r\nOleh karena itu, Komisi Pemberantasan Korupsi (KPK) melakukan kajian sistem pengelolaan komoditas kelapa sawit di Indonesia. Kajian dilakukan dari aspek regulasi, kelembagaan, serta tata laksana pada rantai distribusi kelapa sawit.', 'vyvVopVpbOQ', 1, 'Indonesia', 3, '2021-06-08 16:38:47'),
	(5, 'Tips Menjaga Tanaman Kelapa Sawit Buahnya Tetap Keliling', 'Homepage', 'cara agar kelapa sawit tidak berhenti berbuah walaupun di musim istrahat berbuah .kelapa sawit kita tetap saja rajin berbuah mau tau caranya tonton vidio cara agar kelapa sawit tidak berhenti berbuah dan tonnto vidio cara agar kelapa sawit tidak berhenti berbuah sampai selesai.adapun tiga hal yang harus teman2 lakukan adalah\r\n1.menjaga lahan sawit agar tetap bersih .lakukan penyemprotan rumput/gulma 1 tahun tiga kali\r\n2.lakukan pruning sawit 1 tahun tiga kali\r\n3.lakukan pemupukan sawit 1 tahun tiga kali ', 'C5KNVE4fVwU', 2, 'Indonesia', 3, '2021-06-08 16:47:37');
